import React, { Component } from 'react';
import './App.css';
import Board from './Components/Board'
import Square from './Components/Square'

class App extends Component {
  constructor(){
    super()
    this.state = {
        boardField: Array(9).fill(Array(9).fill("-"))
    }
  }

  createGame = () => {
    var board = []
    for(var i = 0; i < 9; i++){
        board.push(<Square func = {"() => this.changeValueMain()"} value = {<Board key = {i} value = {this.state.boardField[i]} />} size = {"Big"} key = {i + 100} />)
    }
    return board
  }

  render() {
    return (
      <div className="App">
        <h1>Ultimate Tic Tac Toe</h1>
        <div className="MainGame">
          {this.createGame()}
        </div>
      </div>
    );
  }
}

export default App;
